import React from 'react';
import { Route, Routes, Link } from "react-router-dom";

import Home from './components/pages/Home';
import Connect from './components/pages/Connect';

import Handle from './components/handlers/Handle';
import FitbitHandle from './components/handlers/FitbitHandle';
import DeezerHandle from './components/handlers/DeezerHandle';

export default function App() {
    return (
        <div>
            <Routes>
                <Route path='/' element={<Home />}/>
                <Route path='/connect' element={<Connect />} />
                <Route path='/strava' element={<Handle service_name="strava" />}/>  
                <Route path='/fitbit' element={<FitbitHandle />}/>  
                <Route path='/lastfm' element={<Handle service_name="lastfm" />}/>  
                <Route path='/deezer' element={<DeezerHandle />}/>  
            </Routes>
        </div>
    );
}

function NoMatch() {
    return (
        <div>
            <h1>Not Found</h1>
            <p>
                <Link to="/">Go to the home page</Link>
            </p>
        </div>
    );
}
